    false,nt"url": null,nt"notes": "A subset of the National Uranium Resource
    Evaluation (NURE) Hydrogeochemical and Stream Sediment Reconnaissance (HSSR) data
    were used to produce a set of map images depicting the general geochemistry of the
    conterminous US. Approxiamately 260,000 samples from the continental US were analyzed.
    These consisted of solid samples, including stream, lake, pond, spring, and playa
    sediments, and soils. Data for eleven elements were analyzed and included on this
    release of the National Geochemical Atlas: Na, Ti, Fe, Cu, Zn, As, Ce, Hf, Pb, Th,
    and U.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
